import React from "react";

export default function index() {
  return (
    <div className="container">
      <nav>
        <ul>
          <li>
            <a>Contact Me</a>
          </li>

          <li>
            <a>Projects</a>
          </li>

          <li>
            <a>Home</a>
          </li>
        </ul>
      </nav>

        <h1>Hey I am Olalekan</h1>
        <p> Aspiring Full Stack Developer</p>
        <style jsx>
          {`
            .container {
             text-align:center;
             display: flex;
             flex-direction: column;
             justify-content: center;
             align-items: center;
             width: 100%;
             height: 100vh;
            }
            p {
                font-size: 3rem;
                font-weight: 200;
                font-style: italic;
            }
            ul {
                list-style-type:none;
                margin-right: 2rem;
                float: left;
            }
          `}
        </style> <style jsx global>{`
  body {
    background: lightblue};
  }
`}</style>
      </div>

  );
}
